sap.ui.controller("application.workOrderList",{onInit:function(){workOrderListController=this;var b=new sap.ui.model.json.JSONModel({workOrderNumber:""});sap.ui.getCore().setModel(b,"newWorkOrder");var c={data:[]};var a=new sap.ui.model.json.JSONModel(c);sap.ui.getCore().setModel(a,"workOrderList")},onViewWorkOrderPress:function(b){var a=b.getSource().getBindingContext("workOrderList").getObject();workOrderApp.getNavigation().toPage("application.viewWorkOrder",{workOrder:a,action:"viewExisting"})},onReadNewWorkOrderPress:function(b){var a=sap.ui.getCore().getModel("newWorkOrder").getData();if(a===undefined||a===null||a.workOrderNumber===""||a.workOrderNumber.length===0){console.log("no work order number entered");return}a.workOrderNumber.trim();console.log("Work Order to read: "+a.workOrderNumber+".");a.action="readNew";workOrderApp.getNavigation().toPage("application.viewWorkOrder",a)}});